import { createBrowserRouter } from "react-router-dom";
import AdminPage from "../components/AdminPage/AdminPage";
import Form from "../components/Form/Form";

const router = createBrowserRouter([
    {
        path: "/",
        element: <AdminPage />,
    },
    {
        path: "/form",
        element: <Form />,
    },
    {
        path: "/answers",
        element: <></>,
    },
]);

export default router;
